import React from 'react'; // Ensure React is imported
import './App.css';
import Header from './components/Header';
import Home from './components/Home';





function App() {
  return (
    <div className="App">
      <header className="App-header">


        <Header />
        <Home/>
      </header>
    </div>
  );
}

export default App;
